import React from "react";
import {BudgetHistory, TotalBudget} from "./index";
import { UnderlinedTabs } from "../items";

const PortfolioPage = () => {
    return <>
        <TotalBudget/>
        <UnderlinedTabs tabs={[{index: 1, content: <BudgetHistory/>, title: "보유한 종목"},
            {index: 2, content: <BudgetHistory/>, title: "자산 히스토리"}]}/>
    </>
}

export default PortfolioPage;
